    <script>
        "use strict";

process.stdin.resume();
process.stdin.setEncoding("utf-8");

let inputString = "";
let currentLine = 0;

process.stdin.on("data", inputStdin => {

    inputString += inputStdin;
    inputString = inputString.trim().split("\n").map(string => {
        return string.trim();
    });
    main();
    process.exit();
});

function readLine() {
    return inputString[currentLine++];
}

function main() {
    const n = parseInt(readLine());
    const arr = [];
    for (let i = 0; i < n; i++) {
        arr[i] = parseInt(readLine());
    }
    const k = parseInt(readLine());
    const subArray = smallestSubarrayWithSumEqualsK(arr, k);
    if (Array.isArray(subArray) && subArray.length) {

        for (let ele of subArray) {

            if (!ele || !Array.isArray(ele)) {
                console.log(null);
            } else {
                if (ele.length) {
                    console.log(ele.join(" "));
                } else {
                    console.log(null);
                }
            }
        }
    }
    else {
        console.log(null);
    }

}

            sum = sum + arr;
            if(arr == goal){

                console.log(temp)
                smallest.push(temp);

            if(input[i] ==  goal){

                }
